			["Entry_56"]= {"what do you want|to do today","今日は何が|したい？","오늘은 무얼|하고 싶은가","今天想做些什么","что ты собираешься|сегодня делать","was willst du|heute tun","¿qué quieres|hacer hoy?",},
			["Entry_57"]= {"use bombs wisely","ボムは気をつけて使うように","폭탄을 현명하게 쓰라","慎重放炸弹","используй бомбы|с умом","nutze Bomben weise","cuida tus bombas",},
			["Entry_58"]= {"live to die","死ぬために生きよ","죽기 위해 살다","向死而生","живи чтобы умереть","lebe, um zu sterben","vive para morir",},
			["Entry_59"]= {"you are|playing it wrong|give me the controller","遊び方が違う、|コントローラーよこせ","참 못한다|내가 할 테니까|비켜","你太菜了|把手柄给我","ты неправильно|играешь|дай мне контроллер","du spielst|falsch, gib mir|mir den Controller","estás jugando|mal,|déjamelo a mí",},
			["Entry_60"]= {"choose your own path","自分だけの道を歩め","자신의 길을 직접 선택하라","选择你自己的路","выбери свой путь","wähle deinen eigenen|Weg","escoje tu camino",},
			["Entry_61"]= {"your old life|lies in ruin","わびしい生活は|終わりだ","예전의 삶은|이미 사라졌다","你的过往|惨不忍睹","твоя прежняя жизнь|лежит в руинах","dein altes Leben|liegt in Trümmern","tu vida pasada|yace en ruinas",},
			["Entry_62"]= {"i feel asleep!!!","アー！！ ネムイ！！","피곤해!!!","我都困了！！！","я сплю!!!","Ich bin eingedöst!","¡¡¡me duermo!!!",},
			["Entry_63"]= {"may your troubles|be many","不幸多き|人生であれ","네 골칫거리는|한둘이 아닐 것이다","愿你麻烦缠身","пусть проблемы|твои|приумножаться","mögest du viele|Probleme haben","que tus problemas|abunden",},
			["Entry_64"]= {"blame nobody|but yourself","責めるなら|自分自身だ","타인을 탓하지 말고|자신을 탓해라","不要怪别人|只能怪你自己","не вини никого|кроме себя","gib keinem Schuld|außer dir selbst","no culpes a nadie|más que a ti mismo",},
		},
		Fortune_Rules = {
			["Entry_1"]= {"rooms may yield more|than you expect|experimentation is key","部屋の中には想像以上の|ものがあるかもしれない|探究心を忘れずに","방은 생각보다|넓을 수 있다|시행착오가 필요하다","房间里的资源|比你想的要多|敢于尝试是关键","комнаты дают больше|чем ты ожидаешь|экспериментируй","Räume geben mehr|her als erwartet,|experimentiere!","las salas te darán|más de lo que esperas|la clave: experimentar",},
			["Entry_2"]= {"some doors|require a blessing|carry them with you","とある扉は、ご加護がないと|通れない|いつも持ち歩くように","어떤 문들은|축복받은 자에게만|열릴 것이다","有些门需要祝福|记得带上它们","некоторые двери|требуют благословения|возьми их с собой","einige Türen|brauchen Segen,|bring ihn mit","algúnas puertas|necesitan bendición,|llévalas contigo",},
			["Entry_3"]= {"the walls will harden|over time|time is the essence","壁はやがて|硬くなる|時は命なり","시간이 갈 수록|그 벽은 두꺼워져 간다|빠르게 이동하라","墙壁会随|时间推移变厚|抓紧时间","периодически|стены твердеют|суть во времени","Wände werden mit|der Zeit härter,|beeile dich","los muros serán más|duros con el tiempo|el tiempo apremia",},
			["Entry_4"]= {"sleeping gatekeepers|will need to be awoken|with a loud sound","眠る番犬は、|爆音で|起こせる","잠든 문지기들은|큰 소리가 나면|깨어날 것이다","睡着的看门人|需要用一声巨响|来叫醒","спящие привратники|могут проснуться|от громкого звука","schlafende Hüter|müssen durch Lärm|geweckt werden","guardianes dormidos|serán despertados|con un estruendo",},
			["Entry_5"]= {"a piece of paper|is your guide","紙切れは貴方の|道標になるであろう","종이 조각이|너를 이끌 것이다","一张纸|指引你的道路","кусочек бумажки|твой проводник","ein Stück Papier|leitet dich","un pedazo de papel|es tu guía",},
			["Entry_6"]= {"deny his gifts|to attain your reward","彼の誘惑を断り、|真の褒美を受け取りたまえ","그와 계약하지 않으면|보상이 있을 것이다","拒绝他的礼物|获得你的报答","отвергни его дары|и обрети награду","lehne seine Gaben|ab und erhalte|deine Belohnung","niega sus regalos|para ser recompensado",},
			["Entry_7"]= {"a dark market|lies under your feet","闇の市場は、|足元にあり","너의 발 밑에|암시장이 숨겨져 있다","黑市就在你脚下","чёрный рынок лежит|под твоими ногами","ein dunkler Markt|liegt unter|deinen Füßen","un mercado negro|está bajo tus pies",},
			["Entry_8"]= {"chub dislikes smoke!","チャブは煙いところが嫌いらしい！","처브는 폭탄을 싫어해!","胖蛆不喜欢烟！","чаб не любит дым!","Pummel hasst|Rauch!","¡chub odia el humo!",},
